Create PROCEDURE [dbo].[OccupancyCertificate]
	@occupancyCertificateApplicationId int
AS

begin
set nocount on;
SELECT ROW_NUMBER() OVER( ORDER BY (select 1)) AS Sl,* from(
select wmt.waterMeterType as MeterSizes,count(*) as NumberOfMeter from mstWaterConnection mstWC inner join mstWaterMeterType wmt on mstWC.waterMeterTypeId = wmt.waterMeterTypeId where mstWC.isActive = 1 group by wmt.waterMeterType
)gg end

begin
set nocount on;
SELECT ROW_NUMBER() OVER( ORDER BY (select 1)) AS Sl,* from(
select bd.numberOfFloors as NumberOfFloors,count(*) as BuildingCount from mstBuildingDetail bd group by bd.numberOfFloors
)gg end

begin
set nocount on;
select ROW_NUMBER() over(order by(select 1)) as sl, CONVERT(varchar, l.paymentDate,103) as PaymentDate, t.taxName as TaxName, l.totalAmount as TotalAmount, l.penaltyAmount as PenaltyAmount, CONVERT(varchar, @StartDate ,103) as StartDate, CONVERT(varchar, @EndDate ,103) as EndDate
from tblLedger as l inner join tblDemand as d on l.demandId = d.demandId inner join mstTaxMaster as t on l.taxId = t.taxId where d.isPaymentMade = 1 and FORMAT (l.paymentDate, 'yyyyMMdd') >= FORMAT (@StartDate, 'yyyyMMdd') and FORMAT (l.paymentDate, 'yyyyMMdd') <= FORMAT (@EndDate, 'yyyyMMdd')
end

