Create PROCEDURE [dbo].[rptMinorHeadWiseCollectionbycalyear] 
	@CalendarYearId int
	
AS

BEGIN SET NOCOUNT ON;
select ROW_NUMBER() OVER( ORDER BY (select 1)) AS Sl,ConsumerNo, @YearId as Yr, @MonthId as Mnths, MeterNo,Consumption,TotalAmount,PaymentStatus, zoneName from ( ( select wc.consumerNo as ConsumerNo, wc.waterMeterNo as MeterNo, z.zoneName as zoneName, sum(wmr.consumption) as Consumption, sum(l.totalAmount) as TotalAmount,'Paid' as PaymentStatus from tblLedger l left join tblDemand d on l.demandId=d.demandId left join tblTransactionDetail td on l.transactionId = td.transactionId left join tblWaterMeterReading wmr on td.transactionId = wmr.transactionId left join mstZone z on wmr.zoneId = z.zoneId left join mstWaterConnection wc on wmr.waterConnectionId = wc.waterConnectionId left join mstCalendarYear cy on l.calendarYearId = cy.calendarYearId
where td.transactionTypeId = 19 and z.zoneId = @ZoneId and cy.calendarYear =@YearId and isPaymentMade = 1 and MONTH(l.paymentDate) = @MonthId group by ConsumerNo, waterMeterNo,zoneName
) union ( select wc.consumerNo as ConsumerNo, wc.waterMeterNo as MeterNo,z.zoneName as zoneName, sum(wmr.consumption) as Consumption, sum(d.demandAmount) as TotalAmount, 'Unpaid' as PaymentStatus from tblDemand d left join tblTransactionDetail td on d.transactionId = td.transactionId left join tblWaterMeterReading wmr on td.transactionId = wmr.transactionId left join mstWaterConnection wc on wmr.waterConnectionId = wc.waterConnectionId left join mstZone z on wmr.zoneId = z.zoneId left join mstCalendarYear cy on d.calendarYearId = cy.calendarYearId where td.transactionTypeId = 19 and z.zoneId = @ZoneId and cy.calendarYear = @YearId and d.isPaymentMade = 0 and MONTH(d.billingDate) = @MonthId
group by ConsumerNo, waterMeterNo, zoneName
)) f ORDER BY f.ConsumerNo ASC,PaymentStatus asc
END

begin
set nocount on;
SELECT ROW_NUMBER() OVER( ORDER BY (select 1)) AS Sl,* from(
select wct.waterConnectionType as ConnectionType,count(*) as NumberOfConnection from mstWaterConnection mstWC inner join mstWaterConnectionType wct on mstWC.waterConnectionTypeId = wct.waterConnectionTypeId where mstWC.isActive = 1 group by wct.waterConnectionType
)gg end

begin
set nocount on;
SELECT ROW_NUMBER() OVER( ORDER BY (select 1)) AS Sl,* from(
select zo.zoneName, wct.waterConnectionType as ConnectionType,count(*) as NumberOfConnection from mstWaterConnection mstWC inner join mstWaterConnectionType wct on mstWC.waterConnectionTypeId = wct.waterConnectionTypeId inner join mstZone zo on mstWC.zoneId = zo.zoneId group by zo.zoneName, wct.waterConnectionType
)gg end

create PROCEDURE [dbo].[rptOnlinepaymentreconciliations]
	@StartDate date, @EndDate date
AS

SELECT ROW_NUMBER() over(order by(select 1)) as Sl , landUseCategory as LandUseCategory ,landUseSubCategory as LandUseSubCategory,sum(LandCount) as LandCount,sum(landAcerage) AS TotalLandAcerage,SUM(BuildingCount) AS BuildingCount FROM ( ( select c.landUseCategory,sc.landUseSubCategory, count(l.landDetailId) as LandCount,sum(l.landAcerage) as landAcerage,0 as BuildingCount from mstLandDetail l inner join mstLandUseSubCategory sc on l.landUseSubCategoryId=sc.landUseSubCategoryId inner join mstLandUseCategory c on sc.landUseCategoryId=c.landUseCategoryId where sc.isActive=1 group by c.landUseCategory,sc.landUseSubCategory
) UNION ( select c.landUseCategory,sc.landUseSubCategory,0 as LandCount,0 as landAcerage,count(b.buildingDetailId) as BuildingCount from mstLandDetail l inner join mstLandUseSubCategory sc on l.landUseSubCategoryId=sc.landUseSubCategoryId inner join mstLandUseCategory c on sc.landUseCategoryId=c.landUseCategoryId inner join mstBuildingDetail b on l.landDetailId=b.landDetailId where sc.isActive=1 group by c.landUseCategory,sc.landUseSubCategory
)
) T group by LandUseCategory,landUseSubCategory ORDER BY landUseCategory,landUseSubCategory RETURN 0

