create PROCEDURE [dbo].[rptZoneWiseWaterCollection]
@ZoneId int 

AS

BEGIN SET NOCOUNT ON;
select ROW_NUMBER() OVER( ORDER BY (select 1)) AS Sl,@YearId as Yr,ConsumerNo,MeterNo,Consumption,TotalAmount,PaymentStatus,zonename from ( ( select wc.consumerNo as ConsumerNo, wc.waterMeterNo as MeterNo, z.zoneName as zonename, sum(wmr.consumption) as Consumption, sum(l.totalAmount) as TotalAmount,'Paid' as PaymentStatus
from tblLedger l left join tblDemand d on l.demandId=d.demandId left join tblTransactionDetail td on l.transactionId = td.transactionId left join tblWaterMeterReading wmr on td.transactionId = wmr.transactionId left join mstZone z on wmr.zoneId = z.zoneId left join mstWaterConnection wc on wmr.waterConnectionId = wc.waterConnectionId left join mstCalendarYear cy on l.calendarYearId = cy.calendarYearId
where td.transactionTypeId = 19 and z.zoneId = @ZoneId and isPaymentMade = 1
group by ConsumerNo, waterMeterNo, zoneName
) union ( select wc.consumerNo as ConsumerNo, wc.waterMeterNo as MeterNo, z.zoneName as zonename, sum(wmr.consumption) as Consumption, sum(d.demandAmount) as TotalAmount, 'Unpaid' as PaymentStatus
from tblDemand d left join tblTransactionDetail td on d.transactionId = td.transactionId left join tblWaterMeterReading wmr on td.transactionId = wmr.transactionId left join mstWaterConnection wc on wmr.waterConnectionId = wc.waterConnectionId left join mstZone z on wmr.zoneId = z.zoneId left join mstCalendarYear cy on d.calendarYearId = cy.calendarYearId where td.transactionTypeId = 19 and z.zoneId = @ZoneId and d.isPaymentMade = 0
group by ConsumerNo, waterMeterNo, zoneName
)) f ORDER BY f.ConsumerNo ASC,PaymentStatus asc
END

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
select menu_id, menu_name, sum(is_add) as is_add, sum(is_view) as is_view, sum(is_edit) as is_edit from ( (select menu_parent_id,menu_id, menu_name, 0 as is_add, 0 as is_view, 0 as is_edit from tbl_menu where menu_parent_id > 0) union all (select m.menu_parent_id, mm.childmenu_id as menu_id, m.menu_name, is_add, is_view, is_edit from tbl_menumap mm left join tbl_menu m on mm.childmenu_id = m.menu_id where role_id = @p_role_id and is_add is not null and is_view is not null and is_edit is not null) ) T group by menu_id, menu_name, menu_parent_id order by menu_parent_id
END

